import Bord from './Bord';

function BordContainer(props) {

  const style = {
    width: "100%",
    background: "rgba(0,0,0,0.3)",
  };

  return (
    <div className="bordContainer" style={style}>
      <div className="row">
        <Bord />
        <Bord />
        <Bord />
        <Bord />
      </div>
    </div>
  );
}

export default BordContainer;
